apiVersion: apps/v1
kind: Deployment
metadata:
  name: deploy-perf-1
  labels:
    app: deploy-perf-1
spec:
  selector:
    matchLabels:
      app: deploy-perf-1
  replicas: 0
  template:
    metadata:
      labels:
        app: deploy-perf-1
    spec:
      containers:
      - name: helloworld-app-container
        image: "fakeimage"
        imagePullPolicy: IfNotPresent
        ports:
          - containerPort: 3002
        env:
          - name: "PORT"
            value: "3002"
        resources:
          limits:
            cpu: 200m
            memory: 256Mi
          requests:
            cpu: 50m
            memory: 64Mi
